import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


class Filter extends Component {
    constructor(props) {
        super(props);
        this.state = {
            condition: false,
            showRowCondition: false,
            showRowFilter: false,
            showRowCard: false,
            showSearch: false,
            search: '',
        };
        this.toggleMenu = this.toggleMenu.bind(this);
        this.toggleMenu2 = this.toggleMenu2.bind(this);
        this.showRow = this.showRow.bind(this);
        this.showRowCard = this.showRowCard.bind(this);
        this.showRowFilter = this.showRowFilter.bind(this);
        this.handleChange = this.handleChange.bind(this);
        this.showSearch = this.showSearch.bind(this);
        this.sortByPriceAsc = this.sortByPriceAsc.bind(this);
        this.sortByPriceDesc = this.sortByPriceDesc.bind(this);

    }
    toggleMenu() {
        this.setState({condition: true})
        this.setState({showRowFilter: true})
    }
    toggleMenu2() {
        this.setState({condition: false})
        this.setState({showRowCondition: false})
        this.setState({showRowFilter: false})
        this.setState({showRowCard: false})
        this.setState({showRowFilter: false})
        this.setState({showSearch: false})
    }
    showRow() {
      this.setState({showRowCondition: true})
    }
    showRowCard() {
      this.setState({showRowFilter: false})
      this.setState({showRowCard: true})
    }
    showRowFilter() {
      this.setState({showRowCard: false})
      this.setState({showRowFilter: true})
    }
    handleChange(e) {
      this.setState({search: e.target.value})
    }
    showSearch(){
      this.setState({showSearch: true})
      this.setState({showRowFilter: false})
      this.setState({showRowCard: false})
    }

render() {
    return (
        <div>
            <div className="col-6 text-right innerPageNav">
                <div className=""><FontAwesomeIcon icon="search"  size="lg" color="#ddd" onMouseEnter={ this.showSearch }/></div>
                <input type="text" className= { this.state.showSearch ?  'form-control filterInput show' : "form-control filterInput hide" } onChange={this.handleChange} onMouseLeave={ this.toggleMenu2 } placeholder="Search..."  />
                <div className=""><FontAwesomeIcon icon="sort-amount-down"  size="lg" color="#ddd" onMouseEnter={ this.showRowFilter }/></div>
                <div className=""><FontAwesomeIcon icon="grip-horizontal"  size="lg" color="#ddd" onMouseEnter={ this.showRowCard }/></div>
            </div>
            <div className="col-12 text-right">
                  <div className= { this.state.showRowCard ? "card tableToggleWrap" : "card tableToggleWrap toggled" } onMouseLeave={ this.toggleMenu2 }>
                    <div className="card-body">
                      <ul>
                        <li className="tableToggleCard" onClick={this.toggleMenu2}><FontAwesomeIcon icon="th-large" color="#495971"  size="xs"/> Card</li>
                        <li className="tableToggleRow" onClick={this.toggleMenu2}><FontAwesomeIcon icon="table"  color="#495971" size="xs"/> Table</li>
                      </ul>
                    </div>
                  </div>
            <div className= { this.state.showRowFilter ? "card filter tableToggleWrap" : "card filter tableToggleWrap toggled" } onMouseLeave={ this.toggleMenu2 }>
                    <div className="card-body">
                      <ul>
                        <li className="" onClick={this.sortByPriceAsc}><FontAwesomeIcon icon="sort-alpha-down"  color="#495971" size="md"/> ASC</li>
                        <li className="" onClick={this.sortByPriceDesc}><FontAwesomeIcon icon="sort-alpha-up"  color="#495971" size="md"/> DESC</li>
                      </ul>
                    </div>
                    </div>
            </div>
        </div>
    );
  }
}

export default Filter ;
